      */

      function ecdsa_precomputed_hackmem(
        bytes32 message,
        uint[2] calldata rs,
        uint256 endcontract
    ) internal  returns (bool) {
     if (rs[0] == 0 || rs[0] >= n || rs[1] == 0) {
